import React from 'react';
import { SimpleGrid, Heading, Image } from "@chakra-ui/react";
import NP1 from './NP1.jpg';
import NP2 from './NP2.jpg';
import NP3 from './NP3.jpg';
import NP4 from './NP4.jpg';

const NewportBeach = () => {
  return (
    <div>

      <Heading
        size = 'xl'
        position = 'relative'
        fontFamily = 'monospace'
        top = '0px'>
          Newport Beach
      </Heading>

      <SimpleGrid columns={2} spacing="40px">

        <Image
          position = 'relative'
          src = {NP1}
          alt = "NP1"
        />

        <Image
          position = 'relative'
          src = {NP2}
          alt = "NP2"
        />

        <Image
          position = 'relative'
          src = {NP3}
          alt = "NP3"
        />

        <Image
          position = 'relative'
          src = {NP4}
          alt = "NP4"
        />

      </SimpleGrid>

    </div>
  )
};

export default NewportBeach;
